<template>
  <chart
    ref="liquidFill"
    :options="liquidFill"
    :init-options="initOptions"
    theme="ovilia-green"
    autoresize
  />
</template>

<script>
import qs from 'qs'
import ECharts from '../../components/ECharts'
import echarts from 'echarts'
// import 'echarts/lib/chart/l'
import 'echarts-liquidfill/src/liquidFill.js'

const max = 500 // 满刻度大小
const arr = 0.6
const data = max * arr

export default {
  name: 'DvEchartLiquidFill', // 这个名字很重要，它就是未来的标签名<qk-text></qk-text>
  components: {
    chart: ECharts
  },
  props: {
    comData: {
      type: Object,
      default: () => {
        return {
          seriesData: '35%'
        }
      }
    },
    configObj: {
      type: Object,
      default: () => {
        return {
          // 标题配置
          // titleConfig: {
          //   show: true,
          //   top: 'top',
          //   left: 'center',
          //   text: '标题',
          //   textStyle: {
          //     color: '#fff',
          //     fontWeight: 'normal',
          //     fontSize: '18px'
          //   }
          // }
        }
      }
    }
  },
  data() {
    const options = qs.parse(location.search, { ignoreQueryPrefix: true })
    return {
      liquidFill: this.getData(),
      initOptions: {
        renderer: options.renderer || 'canvas'
      }
    }
  },
  // computed: {
  //   ecData() {
  //     return this.echartData
  //   }
  // },
  watch: {
    comData() {
      this.liquidFill = this.getData()
    }
  },
  methods: {

    getData() {
      // 标题配置
      const seriesData = this.comData.seriesData
      return {
        title: {
          top: '47%',
          left: 'center',
          text: seriesData,
          textStyle: {
            color: '#fff',
            fontStyle: 'normal',
            fontWeight: 'normal',
            fontSize: 16
          }
        },
        series: [{
          type: 'liquidFill',
          itemStyle: {
            normal: {
              opacity: 0.4,
              shadowBlur: 0,
              color: '#3B7BF8',
              shadowColor: '#3B7BF8'
            }
          },
          color: [new echarts.graphic.LinearGradient(0, 0, 0, 1, [{
            offset: 0,
            color: '#4A87FF'
          },
          {
            offset: 1,
            color: '#3B7BF8'
          }
          ]), new echarts.graphic.LinearGradient(0, 0, 0, 1, [{
            offset: 0,
            color: '#4A87FF'
          },
          {
            offset: 1,
            color: '#3B7BF8'
          }
          ]), new echarts.graphic.LinearGradient(0, 0, 0, 1, [{
            offset: 0,
            color: '#4A87FF'
          },
          {
            offset: 1,
            color: '#3B7BF8'
          }
          ])],
          name: arr[3],
          data: [{
            value: seriesData,
            itemStyle: {
              normal: {
                color: new echarts.graphic.LinearGradient(0, 0, 0, 1, [{
                  offset: 0,
                  color: '#4A87FF'
                },
                {
                  offset: 1,
                  color: '#3B7BF8'
                }
                ]),
                opacity: 1
              }
            }
          }],
          center: ['50%', '50%'],
          backgroundStyle: {
            color: new echarts.graphic.LinearGradient(0, 0, 0, 1, [{
              offset: 0,
              color: '#3A63E8'
            },
            {
              offset: 1,
              color: '#3213AB'
            }
            ])
          },
          label: {
            normal: {
              formatter: '',
              textStyle: {
                fontSize: 12
              }
            }
          },
          outline: {
            itemStyle: {
              borderColor: '#3F1EB9',
              borderWidth: 10
            },
            borderDistance: 0
          }
        },
        {
          'color': [new echarts.graphic.LinearGradient(0, 0, 0, 1, [{
            offset: 0,
            color: '#5A48E6'
          },
          {
            offset: 1,
            color: '#FFF'
          }
          ]), {
            type: 'linear',
            x: 0,
            y: 0,
            x2: 1,
            y2: 0,
            colorStops: [{
              offset: 0,
              color: 'rgba(31,70,240,1)' // 0% 处的颜色
            }, {
              offset: 1,
              color: 'rgba(255,255,255,0.8)' // 100% 处的颜色
            }]
          }, 'transparent'],
          'type': 'pie',
          'center': ['50%', '50%'],
          'radius': ['50%', '50%'],
          'hoverAnimation': false,
          'data': [{
            'name': '',
            'value': data,
            'label': {
              'show': false,
              'position': 'center',
              'color': '#fff',
              'fontSize': 38,
              'fontWeight': 'bold',
              'formatter': function(o) {
                return data
              }
            }
          },
          { // 画中间的图标
            'name': '',
            'value': 0,
            'label': {
              show: false,
              position: 'inside',
              backgroundColor: {
                image: 'data:image/png;base64,'
              },
              width: 15,
              height: 15,
              borderRadius: 7.5,
              padding: 6
            }
          }, { // 画剩余的刻度圆环
            'name': '',
            'value': max - data,
            'label': {
              show: false
            },
            labelLine: {
              show: false
            }
          }
          ]
        }
        ]
      }
    }
  }
}
</script>

<style lang="scss" scoped>
  .echarts {
    width: 100%;
    height: 100%;
    padding: 0;
    margin: 0;
  }
</style>
